import React from 'react';
import QueEs from '../components/eneagrama/QueEs';
import ParaQueSirve from '../components/eneagrama/ParaQueSirve';
import TiposPersonalidad from '../components/eneagrama/TiposPersonalidad';
import CursoBasico from '../components/eneagrama/CursoBasico';
import Empresas from '../components/eneagrama/Empresas';
import OtrasAplicaciones from '../components/eneagrama/OtrasAplicaciones';

const Eneagrama = () => {
    return (
        <div className="eneagrama-page">
            <h1>Eneagrama</h1>
            <div id="que-es">
                <QueEs />
            </div>
           
        </div>
    );
};

export default Eneagrama;
